import React from "react";

function Contact() {
  return (
    <div className="contact taop-margin">
      <a href="mailto:jeffreyzhao5618@gmail.com">
        <i className="fas fa-envelope primary"></i>
      </a>
      <a href="https://www.linkedin.com/in/jeffrey-zhao-0a56511a1/">
        <i class="fab fa-linkedin primary"></i>
      </a>
      <a href="https://github.com/jeffreyzhao5618">
        <i class="fab fa-github-square primary"></i>
      </a>
    </div>
  );
}

export default Contact;
